import React from 'react';
import FilterWindow from './components/FilterWindow'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App">
        <h1>hello world</h1>
        <FilterWindow/>
      </header>
    </div>
  );
}

export default App;
